import { Ionicons} from '@expo/vector-icons';
import { Pressable } from 'react-native'

export default function IconButton({onPress}) {
    return <Pressable>
        <Ionicons onPress={onPress} name="ios-arrow-back" size={24} color="white" />
    </Pressable>
}
